SOMYA + CONNOR ENGAGEMENT

We had the honor of photographing Somya and Connor’s engagement shoot at sunrise on the beach, and it was a truly magical experience.

The soft light of dawn and the sound of the waves provided the perfect backdrop for this beautiful couple. Watching the fireworks light up the sky only added to the enchanting atmosphere of the shoot.
It’s moments like these that remind us why we love what we do.

